import Image from "next/image";

import { PictureContainer, Picture } from "./styles";

function ProfilePicture() {
  return (
    <PictureContainer>
      <Image src="images/lq_1.jpg" alt="Long-Quan" width={150} height={150} />
    </PictureContainer>
  );
}

export default ProfilePicture;
